  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Yazoo National
  Wildlife Refuge outlines Refuge accomplishments from May to August of 1962. The
  report begins by summarizing the weather conditions and habitat conditions during
  the period. Wildlife- including migratory birds, upland game birds, big game animals,
  furbearers, predators, rodents, mammals, raptors, fish, reptiles, and disease- is
  also covered. The Refuge development and maintenance section discusses physical
  developments, plantings, collections, receipts, prescribed burning, and wildfires.
  Resource management is outlined; topics include grazing, haying, fur harvesting,
  timber removal, and commercial fishing. A progress report on field investigations
  and applied research is also provided. The public relations section of the report
  describes Refuge visitors, recreational uses, hunting, fishing, violations, and
  safety. Attachments include items of interest and photographs.\",\n\t\"owner_org\":
